import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Form,
  Navbar,
  Container,
  Row,
  Col,
  Nav,
  NavDropdown,
  FormControl,
  Button,
  Card,
} from "react-bootstrap";
//import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { CanvasBlock } from "./CanvasBlock";
import NavBar from "./NavBar";
import { MDBContainer, MDBRow, MDBCol, MDBRipple } from "mdbreact";

class Canvas extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="igniteMain">
        <div className="header">
          <NavBar />
          <MDBContainer className="mw-100 mh-100">
            <MDBRow>
              <MDBCol size="3">
                <CanvasBlock />
              </MDBCol>
              <MDBCol size="1">
                <CanvasBlock />
              </MDBCol>
              <MDBCol size="4">
                <CanvasBlock />
              </MDBCol>
              <MDBCol size="5">
                <CanvasBlock />
              </MDBCol>
              <MDBCol size="5">
                <CanvasBlock />
              </MDBCol>
              <MDBCol size="2">
                <CanvasBlock />
              </MDBCol>
            </MDBRow>
          </MDBContainer>
          <MDBRipple
            className="bg-image hover-overlay shadow-1-strong rounded"
            style={{ maxWidth: "22rem" }}
            rippleTag="div"
            rippleColor="light"
          >
            <img
              src="https://mdbcdn.b-cdn.net/img/new/fluid/city/113.jpg"
              className="w-100"
            />
            <a href="#!">
              <div
                className="mask"
                style={{ backgroundColor: "rgba(251, 251, 251, 0.2)" }}
              ></div>
            </a>
          </MDBRipple>
          {/*
            <Container>
              <Row>
                <Col md={4}>md=4</Col>
                <Col
                  md={{ span: 4, offset: 4 }}
                >{`md={{ span: 4, offset: 4 }}`}</Col>
              </Row>
              <Row>
                <Col
                  md={{ span: 3, offset: 3 }}
                >{`md={{ span: 3, offset: 3 }}`}</Col>
                <Col
                  md={{ span: 3, offset: 3 }}
                >{`md={{ span: 3, offset: 3 }}`}</Col>
              </Row>
              <Row>
                <Col
                  md={{ span: 6, offset: 3 }}
                >{`md={{ span: 6, offset: 3 }}`}</Col>
              </Row>
            </Container>
          */}
        </div>
      </div>
    );
  }
}

export default Canvas;
